import React, { Component } from 'react';
import Navbar from '../Navbar';
import {GlobalStyle} from '../Templates/globalStyle'

export default class Template extends Component {
   constructor(props) {
     super(props)
   }
   render() {
      return(
         <div>
            <GlobalStyle whiteColor/>
            <Navbar/>
            {this.props.children}
         </div>
            
      )
   }
}
